import React, {Fragment, useState, useEffect} from 'react';
import Navbar from './Components/Navbar';
import Userlist from './Components/Userlist';
import Form from './Components/Form';

function App() {

  const [user,setUser] = useState({
    Nombres:'',
    Apellidos:'',
    Telefono:'',
    Correo:''
  })

  const [listUpdated, setlistUpdated] = useState(false)

  const [users, setUsers] = useState([])

  useEffect(() => {
    const getUsers = () => {
      fetch('http://localhost:9000/getContactos')
      .then(res => res.json())
      .then(res => setUsers(res))
    }
    getUsers()
  },[])

  return (
    <Fragment>
      <Navbar brand ='Agenda app'></Navbar>
      <div className='container'>
        <h3 style={{textAlign:'center'}} >Ingreso | Edicion | Eliminacion </h3>
        <div className='row'>
          <div className='col-7'>
            <h2 style={{textAlign:'center'}}>Lista de Contactos</h2>
            <Userlist users={users}/>
          </div>
          <div className='col-5'>
            <h2 style={{textAlign:'center'}}>Ingreso de Contactos</h2>
            <Form user={user} setUser={setUser}/>
          </div>
        </div>
      </div>
    </Fragment>
  );
}

export default App;
